import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <h1>My name is Kenil</h1>
    <p>This is my first React app</p>
    <ol>
      <li>Item 1</li>
      <li>Item 1</li>
      <li>Item 1</li>
    </ol>
  </>
);
